<script>

var _sel_mb_1 = "전체";
var _sel_mb_2 = "";

$(".bs--sortList-item").click(function(){
    _sel_mb_1 = $(this).text();
    list_reset();
});

$(".map--area-svg").click(function(){
    var mapNumber = $(this).data("map-number");
    if($(this).hasClass("on")){
        _sel_mb_2 = mapNumber;
    }else{
        _sel_mb_2 = "";
    }

    list_reset();

});

function list_reset(){



    if(_sel_mb_1 == "전체" && _sel_mb_2 == "")
    {
        $(".bs--schoolItem").show();
        return;
    }
    else{
        $(".bs--schoolItem").hide();
    }

    var arr_list = Array();

    arr_list["1"] = "수도권";
    arr_list["2"] = "대경/강원권";
    arr_list["3"] = "동남권";
    arr_list["4"] = "충청권";
    arr_list["5"] = "호남/제주권";

    $('.bs--schoolItem').each(function(index,item){

        if($(item).data("mb_2") == arr_list[_sel_mb_2] || _sel_mb_2 == ""){

            if($(item).data("mb_1") == _sel_mb_1 || _sel_mb_1 == "전체")
            {
                $(item).show();
            }
            else{
                $(item).hide();
            }

        }
    });
}

</script>

